The Babysitter #8 (2013 Sweet Sinner) (Split Scenes)

Starring : James Deen, Dana DeArmond, Chastity Lynn, Xander Corvus, Dillion Harper 

When young babysitter Alice (Chastity Lynn) gets a job for the sexy but bitter Mona (Dana deArmond), she runs the risk of falling for Mona's hatred of her ex-husband and men in general . But when Alice meets Mona's ex (James Deen), she can't help but feel he's been a victim of Mona's scorn. What happens when Alice catches Mona with young stud? And will Alice see through Mona's manipulation to really get to know the handsome ex-husband?

